import React, { useState } from "react";

export default function App() {
 const [state, setState] = useState(0);
  return (
    <div className="App">
      <Todos value={state} setState={setState}/>
    </div>
  );
}

const Todos = ({value, setState}) =>{

  const counting = ()=>{
    setState(value+1)
  }

  return(
    <>
      <button value={value} onclick={counting}>{value}</button>
    </>
  );
};
